import React, { useEffect, useState } from 'react';
import { IonCol, IonGrid, IonRow, IonButton } from '@ionic/react';
import '../css/Global.css';
import '../css/GuidedTourContent.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCalendarTimes } from '@fortawesome/free-regular-svg-icons';

const MyScheduleContent: React.FC<{
    day1: any; 
    day2: any
}> = props => {

    return(
        <>
            <IonGrid className="myScheduleGrid">
            {props.day1 === "day1" ? 
                    <>
                        <IonRow className="ion-justify-content-center myScheduleTableHeaderRow">
                            <IonCol size-sizeSm="2" className="ion-text-wrap" id="hourHeader">Hour</IonCol>
                            <IonCol size-sizeSm="3" className="myScheduleTableHeader ion-text-wrap" id="progNameHeader">Programme Name</IonCol>
                            <IonCol size-sizeSm="3" className="myScheduleTableHeader ion-text-wrap">Time</IonCol>
                            <IonCol size-sizeSm="3" className="myScheduleTableHeader ion-text-wrap">Venue</IonCol>
                            <IonCol size-sizeSm="1" className="myScheduleTableHeader ion-text-wrap"></IonCol>
                        </IonRow>

                        <IonRow className="ion-justify-content-center myScheduleTableHeaderRow">
                            <IonCol size-sizeSm="2" className="myScheduleTableTimeHeader ion-text-wrap">9am</IonCol>
                            <IonCol size-sizeSm="3" className="myScheduleTable-Data ion-text-wrap">Day One</IonCol>
                            <IonCol size-sizeSm="3" className="myScheduleTable-Data ion-text-wrap">Sample</IonCol>
                            <IonCol size-sizeSm="3" className="myScheduleTable-Data ion-text-wrap">Sample</IonCol>
                            <IonCol size-sizeSm="1" className="myScheduleTable-Data">
                                <IonButton className="myScheduleTable-DataBtn" id="removeBtn" size="small" style={{ marginTop: "-5%", marginBottom: "-5%" }} >
                                    <FontAwesomeIcon icon={faCalendarTimes} size="lg" />
                                </IonButton>
                            </IonCol>
                        </IonRow>
                    </> : '' 
                }

                {props.day2 === "day2" ? 
                    <IonRow className="ion-justify-content-center">
                        <IonCol className="guidedTours-Data ion-text-wrap">1</IonCol>
                        <IonCol className="guidedTours-Data ion-text-wrap">Day Two</IonCol>
                        <IonCol className="guidedTours-Data ion-text-wrap">Sample</IonCol>
                        <IonCol className="guidedTours-Data ion-text-wrap">Sample</IonCol>
                        <IonCol size-sizeSm="1" className="myScheduleTable-Data ion-text-wrap">
                            <IonButton className="myScheduleTable-DataBtn" id="removeBtn" size="small" style={{ marginTop: "-5%", marginBottom: "-5%" }} >
                                <FontAwesomeIcon icon={faCalendarTimes} size="lg" />
                            </IonButton>
                        </IonCol>
                    </IonRow> : '' 
                }
            </IonGrid>
        </>
    );
}

export default MyScheduleContent;
